import styled from 'styled-components';

const Wrapper = styled.section`
  gap: 3rem;
  display: flex;
  .card_box {
    position: relative;
    width: 27rem;
    height: 25rem;
    background: #f5f5f5;
    background-repeat: no-repeat;
    background-position: center;

    .flex_top_card {
      display: flex;
      padding: 1.2rem 1.2rem 0.8rem 1.2rem;
      align-items: center;
      justify-content: space-between;
      span {
        background: #db4444;
        padding: 0.4rem 1.2rem;
        color: #fafafa;
        border-radius: 4px;
        font-size: 12px;
        font-weight: 400;
      }

      img {
        width: 16px;
      }

      div {
        display: flex;
        align-items: center;
        background: #fff;
        border-radius: 50%;
        padding: 10px 9px;
      }
    }
    .eye_card {
      float: right;
      margin: 0 1.2rem 0 0;
      background: #fff;
      padding: 10px 7.39px;
      border-radius: 50%;
      display: flex;
      align-items: center;

      img {
        width: 19.23px;
      }
    }

    .add_card {
      position: absolute;
      bottom: 0;
      left: auto;
      right: auto;
    }
  }
`;

export default Wrapper;
